import "./form-input.styles.scss";

const FormInput = ({ value, name, type, onChangeHandler }) => {
  return (
    <input
      type={type}
      required
      onChange={onChangeHandler}
      name={name}
      value={value}
    ></input>
  );
};

export default FormInput;
